staticBinding.value:
$botPath='${botPath}' $folderPath=$botPath + "\Linux_Cpu_Mem_Bot" $masterBotPath=$folderPath+"\MasterBot\" $hostname=hostname ################# Proceeding to execute the Master bot #################################
$memMasterBotPath=$masterBotPath+"MEM_MasterBot1.py"
if(!(Test-Path $memMasterBotPath)) {
return "Failed: Master script not present on $hostname"
} Start-Process "${pythonPath}" -ArgumentList "$memMasterBotPath '${targetList}' '${targetUsername}' '${targetPassword}' '${ticketNumber}' '${customerName}' '${region}' '${centralIp}' '${centralUsername}' '${centralPassword}' '${centralPort}' '${alertName}' '${alertUUID}' '$hostname' '${overrideJRAS}' '${username}' '${password}' '${smtpServer}' '${dbServer}' '${db_user}' '${db_passwd}' '${fromMail}' '${toMail}' '${memThreshold}' 'False'" -WindowStyle Hidden
return "success $hostname"

